import Navbar from "../../components/Navbar";
import ProductDetail from "../../components/ProductDetail";

const ProductDetailPage = () => {
    return (
        <>
            <Navbar />
            <main className="container mt-4">
                <ProductDetail />
            </main>
        </>
    );
};

export default ProductDetailPage;
